import React, { useState, useRef, useEffect } from "react";
import { FaTimes } from "react-icons/fa";

const SeeDoGrowSection = () => {

  const [showVideo1, setShowVideo1] = useState(false); // for first section
  const [showVideo2, setShowVideo2] = useState(false); // for second section
  const [showVideo3, setShowVideo3] = useState(false); // for third section
  const [showVideo4, setShowVideo4] = useState(false); // for fourth section
  const [showVideo5, setShowVideo5] = useState(false); // Fifth section
  const [showVideo6, setShowVideo6] = useState(false); // Sixth section

  const [playInCircle1, setPlayInCircle1] = useState(false);
  const [playInCircle2, setPlayInCircle2] = useState(false);
  const [playInCircle3, setPlayInCircle3] = useState(false);
  const [playInCircle4, setPlayInCircle4] = useState(false);
  const [playInCircle5, setPlayInCircle5] = useState(false);
  const [playInCircle6, setPlayInCircle6] = useState(false);

  const circleRef1 = useRef(null);
  const circleRef2 = useRef(null);
  const circleRef3 = useRef(null);
  const circleRef4 = useRef(null);
  const circleRef5 = useRef(null);
  const circleRef6 = useRef(null);

  // Section 1 scroll detection
  useEffect(() => {
    const observer1 = new IntersectionObserver(
      ([entry]) => setPlayInCircle1(entry.isIntersecting),
      { threshold: 1 }
    );
    if (circleRef1.current) observer1.observe(circleRef1.current);
    return () => {
      if (circleRef1.current) observer1.unobserve(circleRef1.current);
    };
  }, []);

  // Section 2 scroll detection
  useEffect(() => {
    const observer2 = new IntersectionObserver(
      ([entry]) => setPlayInCircle2(entry.isIntersecting),
      { threshold: 1 }
    );
    if (circleRef2.current) observer2.observe(circleRef2.current);
    return () => {
      if (circleRef2.current) observer2.unobserve(circleRef2.current);
    };
  }, []);

  // useEffect for 3rd section
useEffect(() => {
  const observer = new IntersectionObserver(
    ([entry]) => setPlayInCircle3(entry.isIntersecting),
    { threshold: 1 }
  );
  if (circleRef3.current) observer.observe(circleRef3.current);
  return () => {
    if (circleRef3.current) observer.unobserve(circleRef3.current);
  };
}, []);

// useEffect for 4th section
useEffect(() => {
  const observer = new IntersectionObserver(
    ([entry]) => setPlayInCircle4(entry.isIntersecting),
    { threshold: 1 }
  );
  if (circleRef4.current) observer.observe(circleRef4.current);
  return () => {
    if (circleRef4.current) observer.unobserve(circleRef4.current);
  };
}, []);
// Auto play when scrolled into view
useEffect(() => {
  const observer5 = new IntersectionObserver(
    ([entry]) => setPlayInCircle5(entry.isIntersecting),
    { threshold: 1 }
  );
  if (circleRef5.current) observer5.observe(circleRef5.current);
  return () => {
    if (circleRef5.current) observer5.unobserve(circleRef5.current);
  };
}, []);

useEffect(() => {
  const observer6 = new IntersectionObserver(
    ([entry]) => setPlayInCircle6(entry.isIntersecting),
    { threshold: 1 }
  );
  if (circleRef6.current) observer6.observe(circleRef6.current);
  return () => {
    if (circleRef6.current) observer6.unobserve(circleRef6.current);
  };
}, []);

  return (
    <div className="bg-white font-rubik">
      <div className="bg-white font-rubik">
      {/* Section 1 */}
      <VideoSection
        id={1}
        activeVideo={activeVideo}
        setActiveVideo={setActiveVideo}
        playInCircle={playInCircle[1]}
        circleRef={circleRefs[1]}
        title="See. Do. Grow."
        subtitle="This is how STOQ works"
        description="See everything in one place. Do what matters in an instant—hand off to a teammate, chat on the item, update its status, restock, or move it where it’s needed. Grow efficiency with zero guesswork and nothing but clear, positive results."
        videoSrc="/videos/LandingPage/main video.mp4"
        imageSrc="/videos/LandingPage/1.png"
        reverse={false}
        textColor="#4F6B1C"
      />

      <hr className="border-t-2 border-gray-100 mx-20 mb-2" />

      {/* Section 2 */}
      <VideoSection
        id={2}
        activeVideo={activeVideo}
        setActiveVideo={setActiveVideo}
        playInCircle={playInCircle[2]}
        circleRef={circleRefs[2]}
        title="Instant clarity from the first use"
        description="STOQ thinks like you do. Its game-style interface makes using STOQ fun—no training required."
        videoSrc="/videos/LandingPage/instant.mp4"
        imageSrc="/videos/LandingPage/2.png"
        reverse={true}
        textColor="#8CB031"
      />

      <hr className="border-t-2 border-gray-100 mx-20 mb-2" />

      {/* Section 3 */}
      <VideoSection
        id={3}
        activeVideo={activeVideo}
        setActiveVideo={setActiveVideo}
        playInCircle={playInCircle[3]}
        circleRef={circleRefs[3]}
        title="One Live Timeline, Zero Chaos."
        description="STOQ lets you run everything with confidence. It maps each item’s life cycle, so you always see what’s on hand, what’s running low, and the next action to take."
        videoSrc="/videos/LandingPage/lifeline 0 chaos.mp4"
        imageSrc="/images/about.jpg"
        reverse={false}
        textColor="#596F22"
      />

      <hr className="border-t-2 border-gray-100 mx-20 mb-2" />

      {/* Section 4 */}
      <VideoSection
        id={4}
        activeVideo={activeVideo}
        setActiveVideo={setActiveVideo}
        playInCircle={playInCircle[4]}
        circleRef={circleRefs[4]}
        title="Your Entire Workflow in One Place"
        description="No juggling apps, no switching tabs. STOQ keeps all your work together, simple and clear."
        videoSrc="/videos/LandingPage/workflow.mp4"
        imageSrc="/videos/LandingPage/4.png"
        reverse={true}
        textColor="#4F6B1C"
      />

      <hr className="border-t-2 border-gray-100 mx-20 mb-2" />

      {/* Section 5 */}
      <VideoSection
        id={5}
        activeVideo={activeVideo}
        setActiveVideo={setActiveVideo}
        playInCircle={playInCircle[5]}
        circleRef={circleRefs[5]}
        title="Every Item, Every Detail, Every Time"
        description="Track every piece of work with precision. Nothing slips through, nothing gets missed."
        videoSrc="/videos/LandingPage/details.mp4"
        imageSrc="/videos/LandingPage/5.png"
        reverse={false}
        textColor="#8CB031"
      />

      <hr className="border-t-2 border-gray-100 mx-20 mb-2" />

      {/* Section 6 */}
      <VideoSection
        id={6}
        activeVideo={activeVideo}
        setActiveVideo={setActiveVideo}
        playInCircle={playInCircle[6]}
        circleRef={circleRefs[6]}
        title="Live, always-synced updates"
        description="Everyone sees the same info in real time. No delays, no duplicate effort."
        videoSrc="/videos/LandingPage/Life synd & lasting histpry top.mp4"
        imageSrc="/images/about.jpg"
        reverse={true}
        textColor="#596F22"
      />
    </div>



     {/* lets get started button at center */}
        <div className="flex justify-center py-20">
            <a href="/get-started" className="bg-[#A9CF45] text-black px-6 py-3 rounded-full text-md font-semibold hover:bg-[#8BB833] transition-colors">
            Let's get started
            </a>
        </div>

         {/* Divider Line */}
      <hr className="border-t-2 border-gray-100 mx-20 mb-2" />

    </div>



  );
};

export default SeeDoGrowSection;
